import React from 'react';
import './main.css';
import Formulario from '../Formulario';

const Main = () => (
    <main>
        <Formulario texto ="Oi, amigo" 
        sub="Faça login na sua conta Rocket para recuperar seus códigos. 
        Ou cadastre-se aqui" />
        <div className="inputs"></div>
    </main>
);

export default Main;
